import React from "react";
import Button from "./Button";
const LoginPage = () => {
  const container = {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  };
  return (
    <>
      <div className="conatiner">
        <h1>This is Login page </h1>
        <Button />
      </div>
    </>
  );
};
export default LoginPage;
